import NavBar from './NavBar';
import Hero from './Hero';
import Card from './Cards';
import { experiences } from "./Experiences";

const cards = experiences.map(card => <Card { ...card }/>);

export default function App() {
  return (
    <div>
        <NavBar />
        <Hero />
        { cards }
    </div>
  );
}
